import request from './DataUtil';


export function getImgPages(params) {
    return request({
        url: "/files/page", //api
        method: "get",
        params:params
    });
}

export function uploads(params) {
    return request({
        url: "/files/uploads", //api
        method: "post",
        params:params
    });
}
